tuple_sum = lambda a, b: tuple(a_n + b_n for a_n, b_n in zip(a, b))

directions = [(1, 0), (0, -1), (-1, 0), (0, 1)]

direction = directions[0]

def is_in_grid(position, width, height):
    return 0 <= position[0] < height and 0 <= position[1] < width

used = set()
steps = 0

while is_in_grid(position, width, height) and grid[position] != ' ':
    steps += 1
    used.add(position)
    if grid[position] == '+':
        for neighbor_direction in directions:
            neighbor = tuple_sum(position, neighbor_direction)
            if is_in_grid(neighbor, width, height) and grid[neighbor] != ' ' and neighbor not in used:
                direction = neighbor_direction
                break
    position = tuple_sum(position, direction)

print(steps)
